import Landing from "./pages/landing";
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom'

function App() {
  return (
      <BrowserRouter> 
        <Routes>
          <Route path="/"></Route>
          <Landing/>
        </Routes>
     </BrowserRouter>
  );
}

export default App;
